import "./App.css";

import Register from "./components/Register";
import Login from "./components/Login/login";
import { BrowserRouter, Route, Switch } from "react-router-dom";
import NewsTop from "./components/NewsTop";
import NewsForDate from "./components/NewsForDate";
import { Navigation } from "./components/Navigation/Navigation";
import { NewsSinglePage } from "./components/NewsSinglePage";
import NewsCategory from "./components/NewsCategory";

import ProfilePage from "./components/ProfilePage";
import Logout from "./components/Logout";
import PostNews from "./components/PostNews";
import UpdateUserProfile from "./components/UpdateUserProfile";
import ErrorBanner from "./components/ErrorBanner";

function App() {
  return (
    <BrowserRouter>
      <ErrorBanner />
      <Navigation />
      <div className="App">
        <Switch>
          <Route path="/login">
            <Login />
          </Route>
          <Route path="/logout">
            <Logout />
          </Route>
          <Route path="/profile">
            <ProfilePage />
          </Route>
          <Route path="/register">
            <Register />
          </Route>
          <Route path="/NewsForDate">
            <NewsForDate />
          </Route>
          <Route path="/NewsCategory/:category/">
            <NewsCategory />
          </Route>
          <Route path="/postNews">
            <PostNews />
          </Route>
          <Route path="/news/:id">
            <NewsSinglePage />
          </Route>
          <Route path="/profile">
            <ProfilePage />
          </Route>
          <Route path="/UpdateUserProfile">
            <UpdateUserProfile />
          </Route>
          <Route path="/">
            <NewsTop />
          </Route>
        </Switch>
      </div>
    </BrowserRouter>
  );
}

export default App;
